import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六庚日丁亥时断</p><p>六庚日生时丁亥，官星失地自身衰；</p><p>不通月气难成福，若见魁罡却妙哉。</p><p>庚日丁亥时，庚以甲为财，壬为食，丁为官。</p><p>亥上丁火无气，壬旺甲生，庚金失地，难任财食。</p><p>若不通身旺月，不能成福；通月气、有阴土扶身者，发财。</p><p>官星有助，稍贵。</p><p>庚戌，庚辰此二日魁罡，不宜财官生旺；时逢丁亥，反贵。</p><p>庚子日丁亥时，贵。</p><p>申子辰月，伤官、劳碌。</p><p>卯月、金火运、五六品贵。</p><p>庚寅日丁亥时，平，初贫，中秀，末主富旺。</p><p>辰戌年月，贵显。</p><p>申酉亥卯已午年月，干透乙已者，大贵。</p><p>庚辰日丁亥时，纯未，显达。</p><p>已午，西北运，风宪、金紫。</p><p>亥卯、金紫，有权。</p><p>申月，建禄，最吉。</p><p>庚午日丁亥时，贵。</p><p>辰戌丑未月，土能生金，荣显。</p><p>申亥酉月，行木火运，极品。</p><p>庚申日丁亥时，秋生，南运，贵显；北运，平常。</p><p>庚戌日丁亥时，辰已午月，官煞虽混，亦主武贵。</p><p>丑月，西运，郎官。</p><p>辰月，西北运，方面。</p><p>丁亥时逢庚日排，重重喜色照朱扉；桃红烂漫日时绽，一阵春风自显威。</p><p>庚日时逢丁亥，柱中暗合三奇。</p><p>要知子旺并三妻，父母雁行可美。</p><p>癸已戊辛不遇，文章博览多知。</p><p>无冲无破贵人提，终末亨通吉利。</p>",30),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","250卷 九·六庚日丁亥时断.html.vue"]]);export{f as default};
